INSERT INTO `restaurants` VALUES ('1', 'Keese\'s', 'Welcome to Keese??™s Restaurant. If you are looking for a quick lunch, take out or delivery you have found the perfect place.\n\nAt Keese\'s, each meal is freshly prepared using only the finest ingredients.\n\nOur menu selections include several unique dishes you\'ll be sure to enjoy.\n\nWe hold our friendly and knowledgeable staff to the same high standard as our food.\n\nWe encourage your comments and suggestions and would enjoy hearing from you.\n\nsend e-mail to: Denise', '1359506673Picture 8.png', '0', '0', '', '', '', '15.00', '6', '1', '2029-01-13 16:44:00', 'catherinedicioccio@gmail.com', '98', '2014-01-04 18:05:54', '2014-01-24 10:31:10', null, null, null, '1359506673Picture_8.png', 'image/png', '24906', '2014-01-24 10:31:09');
INSERT INTO `restaurants` VALUES ('2', 'Cat\'s Pub ', 'Welcome to Cat\'s Pub Restaurant. If you are looking for a quick lunch, take out or delivery you have found the perfect place.\n\nAt Keese\'s, each meal is freshly prepared using only the finest ingredients.\n\nOur menu selections include several unique dishes you\'ll be sure to enjoy.\n\nWe hold our friendly and knowledgeable staff to the same high standard as our food.\n\nWe encourage your comments and suggestions and would enjoy hearing from you.\n\nsend e-mail to: Denise', '1370521681Penguins.jpg', '0', '0', '', '', '', '2.00', '6 ', '1', '2008-03-13 09:22:00', 'foodpaltest@gmail.com', '98', '2014-01-04 18:05:54', '2014-01-24 10:31:10', null, null, null, '1370521681Penguins.jpg', 'image/jpeg', '31410', '2014-01-24 10:31:10');
INSERT INTO `restaurants` VALUES ('3', 'Carina\'s Pizza ', 'We strive for excellence and are confident you will have an exceptional dining experience at our restaurant in Miami or our Fort Lauderdale location. Whether you want a stone fired pizza hot out of the oven, signature sandwiches with freshly baked bread, a variety of tasty pasta, salads and more... It\'s all here!\nTry Carina\'s Stone Fired Pizza-Gelato. If you feel like staying in, consider Carina\'s Pizza delivery or choose from any of the other menu options. We always use the freshest ingredients.\n', '1380189903183277_173139709405553_6012352_n.jpg', '0', '0', 'https://www.facebook.com/pages/Carinas-Stone-Fired-Pizza-Gelato/173137156072475', 'https://twitter.com/CP1Miami', 'https://plus.google.com/113928813080717034971/about', '10.00', '6 ', '1', '2012-06-13 08:57:00', 'catherinedicioccio@gmail.com', '98', '2014-01-04 18:05:54', '2014-01-24 10:31:11', null, null, null, '1380189903183277_173139709405553_6012352_n.jpg', 'image/jpeg', '39435', '2014-01-24 10:31:11');
