INSERT INTO `restaurants` VALUES ('5', 'Broadway\'s Hot Grill', 'Broadway’s Hot Grill is one of the newest restaurants in town, owned and operated by Gihan and Halim Hanna. Following their passion for the food industry, they opened their first restaurant nine years ago in Tallahassee, FL, sharing quality Gyros, Philadelphia cheese steak, and hamburgers, among many other varieties of food, with a cutting edge. \n\nSucceeding with their first restaurant, Mr. and Mrs. Hanna decided to go independent and opened Broadway’s Hot Grill with currently two locations for Broadway’s Hot Grill located at the Tallahassee Mall in the food court, 2415 N. Monroe Street and on 435 W. Tennessee St. next to Popeye’s. At Broadway’s Hot Grill everything is made fresh! You will find a variety of foods – from American to Greek- backed by more than 10 years of experience. At Broadway’s Hot Grill you can enjoy your favorite Philly cheese steak, Gyros, Angus beef Hamburgers, Fried Chicken, Wings and much more. If you don’t like having to wait on the North Florida Fair to enjoy your Funnel Cake, once a year, you can stop by Broadway’s Hot Grill and be sure to find different flavors year round. \n\nBroadway’s Hot Grill is opened early mornings, for your convenience, to enjoy the most important meal of the day. Find a variety of breakfast items from ham, eggs, grits, waffles, pancakes, and much more. If you are a seafood lover they also have Butterfly shrimp and Catfish, Freshly cut Gyro meat, homemade rice and your choice of a side. \n\nMake sure you go and check it out, you won’t regret it!!', '1375207678broadway.jpg', '2', '0', '', '', '', '12.00', '6', '1', '2025-07-13 13:41:00', 'Halimhanne@aol.com', '829', '2014-01-04 18:05:54', '2014-01-24 10:31:12', null, null, null, '1375207678broadway.jpg', 'image/jpeg', '12712', '2014-01-24 10:31:12');
INSERT INTO `restaurants` VALUES ('6', '101 Restaurant ', 'Situated on the first floor of Kleman Plaza\'s Tallahassee Center, 101 is Tallahassee\'s one and only social dining location. ', '1375206771101_restaurant_logo.jpg', '1', '1', '', '', '', '', '', '1', '2030-07-13 10:52:00', '', '829', '2014-01-04 18:05:54', '2014-01-24 10:31:13', null, null, null, '1375206771101_restaurant_logo.jpg', 'image/jpeg', '21152', '2014-01-24 10:31:12');
INSERT INTO `restaurants` VALUES ('7', 'Kilted Mermaid', 'Our ever changing menus include artisan cheeses that are all available in cheese plates. We also have flatbreads, sandwiches, salads and other small plates.', '1378118520kiltedmer.tiff', '2', '0', 'https://www.facebook.com/pages/Kilted-Mermaid/116193255128849', '', 'https://plus.google.com/100598035750903421497/about', '0.00', '6', '1', '2002-09-13 03:42:00', '', '1013', '2014-01-04 18:05:54', '2014-01-04 18:05:54', null, null, null, null, null, null, null);
INSERT INTO `restaurants` VALUES ('8', 'South Beach Pizzeria', 'A small family-owned pizzeria with mouthwatering pizzas!', '1378119277190535_192474217455680_6204266_n.jpg', '0', '0', 'https://www.facebook.com/pages/South-Beach-Pizzeria/192473764122392', '', 'https://plus.google.com/107823878081348607029/about', '0.00', '6', '1', '2002-09-13 03:54:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:13', null, null, null, '1378119277190535_192474217455680_6204266_n.jpg', 'image/jpeg', '29362', '2014-01-24 10:31:13');
INSERT INTO `restaurants` VALUES ('9', 'Nino\'s Italian Restaurant & Pizzeria', 'Where basil, garlic, tomato and crispy crust come together to make the perfect pizza! Try one of our wonderful pastas, or delectable desserts!', '1378119862l.jpg', '0', '0', 'https://www.facebook.com/pages/Ninos-Italian-Restaurant-Pizzeria/120453237965612', '', '', '0.00', '6', '1', '2002-09-13 04:04:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:14', null, null, null, '1378119862l.jpg', 'image/jpeg', '14105', '2014-01-24 10:31:13');
INSERT INTO `restaurants` VALUES ('10', 'Pizzoodles', 'We think people love small, family owned Italian style restaurants that offer well prepared, flavorful dishes - and that\'s what we are famous for. Our menu centers around pizza, calzones, and a variety of delicious pasta dishes. Our appetizers are enticing, and our salads are scrumptious. Deserts are to die for!', '137812024912966.jpg', '0', '0', 'http://www.facebook.com/pages/Pizzoodles-Restaurant/118771994832274', 'https://twitter.com/PizzoodlesTooIn', 'https://plus.google.com/101704578744309984413/about', '', '6', '1', '2002-09-13 04:10:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:14', null, null, null, '137812024912966.jpg', 'image/jpeg', '24603', '2014-01-24 10:31:14');
INSERT INTO `restaurants` VALUES ('11', 'Red Onion Eatery', 'A small sandwich palace in downtown Vero Beach! Tasty grilled asparagus and homemade chips! Try our grouper sandwich, reuben sandwich, or ahi tuna salad!', '1378120683rologo250.jpg', '0', '0', 'https://www.facebook.com/pages/Red-Onion-Eatery/100881189955927?rf=242235935879919', '', 'https://plus.google.com/105741383935961816316/about', '0.00', '6', '1', '2002-09-13 04:18:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:15', null, null, null, '1378120683rologo250.jpg', 'image/jpeg', '21951', '2014-01-24 10:31:14');
INSERT INTO `restaurants` VALUES ('12', 'The Noodle House', 'Experience authentic Asian cooking at The Noodle House! We have a sushi bar, and incorporate Thai, Japanese, and Vietnamese cuisine into our menu. ', '1378121439268452_123206237767254_3006929_n.jpg', '0', '0', 'https://www.facebook.com/thenoodlehouse', '', 'https://plus.google.com/115346518207047888819/about', '0.00', '6', '1', '2002-09-13 04:30:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:15', null, null, null, '1378121439268452_123206237767254_3006929_n.jpg', 'image/jpeg', '37084', '2014-01-24 10:31:15');
INSERT INTO `restaurants` VALUES ('13', 'Moe\'s Deli', 'Moes Deli of Vero Beach | Proudly Serving Boars Head Meats. Family owned and operated, this small bistro makes the best sandwiches from quality meats and cheeses.', '1378121971l.jpg', '0', '0', '', '', 'https://plus.google.com/116431668230808472042/posts', '0.00', '6', '1', '2002-09-13 04:39:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:16', null, null, '1', '1378121971l.jpg', 'image/jpeg', '13407', '2014-01-24 10:31:15');
INSERT INTO `restaurants` VALUES ('14', 'The Joy of Eating', 'The Joy of Eating is a small family owned cafe, and has become a gem in the neighborhood. This small creperie incorporates organic food to make the most delicious sweet and savory style crepes. Take a cup of rich organic coffee to go!', '1378128644734602_191795664296609_1399774504_n.jpg', '0', '0', 'https://www.facebook.com/JoyofEating', '', '', '0.00', '6', '1', '2002-09-13 06:30:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:16', null, null, null, '1378128644734602_191795664296609_1399774504_n.jpg', 'image/jpeg', '14521', '2014-01-24 10:31:16');
INSERT INTO `restaurants` VALUES ('15', 'Tubby\'s All American Subs', 'Ready for an All-American sub at Tubby\'s? Our thick pastrami on homemade bread has got critics raving! With generous portion sizes, we are sure to fill you up!', '1378129453644224_462911053748618_1393884402_n.jpg', '0', '0', 'https://www.facebook.com/pages/Tubbys-All-American-Subs/123852704321123', '', 'https://plus.google.com/107405270532406555540/about', '0.00', '6', '1', '2002-09-13 06:35:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:17', null, null, null, '1378129453644224_462911053748618_1393884402_n.jpg', 'image/jpeg', '29114', '2014-01-24 10:31:17');
INSERT INTO `restaurants` VALUES ('16', 'Subperior Sandwiches', 'SUBperior\'s menu offers Subs and Salads. We have Vero\'s best Cheesesteak and we always use freshly sliced meats and veggies. Not to mention the best pasta salad and coleslaw.', '1378133047297548_263959603642576_490736192_n.jpg', '0', '0', 'https://www.facebook.com/pages/Subperior-Sandwiches/196988317006372', 'https://twitter.com/VerosBestSubs', 'https://plus.google.com/108574690194508954766/about', '0.00', '6', '1', '2002-09-13 07:44:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:18', null, null, null, '1378133047297548_263959603642576_490736192_n.jpg', 'image/jpeg', '40499', '2014-01-24 10:31:17');
INSERT INTO `restaurants` VALUES ('17', 'Einstein Bros Bagels', 'As the nation\'s largest operator of bagel bakeries and the leader in the quick casual segment of the restaurant industry, Einstein Noah Restaurant Group is moving with the cultural shift toward food that is fast, but never tastes that way. Think fresh-baked goods, made-to-order sandwiches, crisp salads and gourmet coffee.', '1378133905523536_261575533946038_1988234417_n.jpg', '0', '0', 'https://www.facebook.com/pages/Einstein-Bros-Bagels-Vero-Beach/240097746093817', 'https://twitter.com/EinsteinBros/status/349911646912778241', 'https://plus.google.com/113093834822399275910/about', '0.00', '6', '1', '2002-09-13 07:58:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:18', null, null, null, '1378133905523536_261575533946038_1988234417_n.jpg', 'image/jpeg', '24447', '2014-01-24 10:31:18');
INSERT INTO `restaurants` VALUES ('18', 'The Barefoot Cafe', 'We welcome you to visit The Barefoot Cafe for a weekday breakfast or lunch. You\'ll be glad you did. We offer a creative, fresh, and healthy menu that allows for you to spend as little or as much time away from the office as you\'d like. Whether it\'s a salad, a hot wrap, or a bowl of soup - there\'s going to be something on our menu that you\'ll want to try.', '1378134393166485_181911751831470_2784511_n.jpg', '0', '0', 'https://www.facebook.com/pages/The-Barefoot-Cafe/181911255164853?rf=115630961793254', '', 'https://plus.google.com/101577156357777505219/posts', '0.00', '6', '1', '2002-09-13 08:06:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:19', null, null, null, '1378134393166485_181911751831470_2784511_n.jpg', 'image/jpeg', '26773', '2014-01-24 10:31:18');
INSERT INTO `restaurants` VALUES ('19', 'La Cucina Di Nola', 'The gourmet Italian restaurant, La Cucina di Nola (The Kitchen of Nola) is home to Vero Beach\'s best wood-fired brick oven, the flames of which are kept hovering at 800 F by James and his staff.\n\nItalian food and pizza cooked in a wood-fired brick oven has a distinct \'magic\' that must be experienced! No other brick oven-cooked foods are going to be able to deliver the same sensory experience because they are either electric or propane.\n\nWe believe it\'s worth the work necessary to deliver naturally-cooked, hand-prepared foods from the freshest ingredients. Our signature pasta, made right in-house from scratch, from the best pasta flours and other premiere ingredients sets us apart!', '1378134728407860_352098731474614_1628912698_n.jpg', '0', '0', 'https://www.facebook.com/lacucinadinola', '', '', '0.00', '6', '1', '2002-09-13 08:12:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:19', null, null, null, '1378134728407860_352098731474614_1628912698_n.jpg', 'image/jpeg', '14820', '2014-01-24 10:31:19');
INSERT INTO `restaurants` VALUES ('20', 'Bella Napoli Restaurant', 'At Bella Napoli Ristorante, we strive to use only the freshest and highest quality ingredients. Since we are family owned and operated, all meats and seafood are hand selected, inspected, and taste tested to assure our patrons dining experience is the best.\n\nAll of our dishes are prepared with Extra Virgin Olive Oil not only for the great taste, but also for your health. Our bread, sauces, and dressing is made fresh (in our kitchen) daily.', '13781351292013-03-17.jpg', '0', '0', 'https://www.facebook.com/pages/Bella-Napoli-Restaurant/116003715088407', '', 'https://plus.google.com/112179270545277996926/about', '0.00', '6', '1', '2002-09-13 08:18:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:20', null, null, null, '13781351292013-03-17.jpg', 'image/jpeg', '27160', '2014-01-24 10:31:20');
INSERT INTO `restaurants` VALUES ('21', 'Barnacle Bill\'s', 'We offer quality “Fresh From Florida” seafood, along side of worldly favorites like Alaskan salmon, snow crab legs, cold water Atlantic Pollock and halibut (seasonal), Caribbean rock lobster tails and rock shrimp (seasonal). Then we blow your culinary minds with ½ LB Black Angus burgers and the best wings in town. We also make homemade oyster stew and seafood gumbo, a variety of salads, dips and pastas. We hand cut each piece of fish or meat, and our meals are cooked to order so fried, grilled, broiled, or steamed is never a problem. Kids get their own menu packed with all their favorites. After 32 years we have covered all the bases for you – batter up!!', '1378204175200_8264643925_8763_n.jpg', '2', '0', 'https://www.facebook.com/barnacle.stilwell', '', 'https://plus.google.com/115969984666884167088/about', '0.00', '6', '1', '2003-09-13 03:29:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:20', null, null, null, '1378204175200_8264643925_8763_n.jpg', 'image/jpeg', '35482', '2014-01-24 10:31:20');
INSERT INTO `restaurants` VALUES ('22', 'Atomic Coffee', 'ATOMIC COFFEE combines world-class coffee & gourmet, made-to-order breakfast & lunch sandwiches as well as fresh baked goodies & more!\nAtomic features the finest coffee in the world, from the finest roasters in the country... Intelligentsia & Counter Culture.', '1378204732299153_433081336781563_887151816_n.jpg', '0', '0', 'https://www.facebook.com/AtomicCoffeeTally', 'https://twitter.com/atomictally', 'https://plus.google.com/117720424686737071584/about', '0.00', '6', '1', '2003-09-13 03:38:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:21', null, null, null, '1378204732299153_433081336781563_887151816_n.jpg', 'image/jpeg', '23660', '2014-01-24 10:31:21');
INSERT INTO `restaurants` VALUES ('23', 'Tomahawk Sports Bar & Grill', 'We are an all- american sports bar with those tasty snacks you\'ve been craving! Try our home fried pickles or one of our famous mouthwatering burgers!', '1378205168hawkweb.jpg', '0', '0', 'https://www.facebook.com/TheTomahawkSportsBar', 'https://twitter.com/tomahawktally', 'https://plus.google.com/117007813771870463649/about', '0.00', '6', '1', '2003-09-13 03:46:00', 'info@thetomahawksportsbar.com', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:21', null, null, null, '1378205168hawkweb.jpg', 'image/jpeg', '35013', '2014-01-24 10:31:21');
INSERT INTO `restaurants` VALUES ('24', 'Mr Roboto Tokyo Grill', 'Roboto Tokyo Grill is a fast casual restaurant chain located in Tallahassee, Florida. We serve Japanese hibachi and also offer a variety of pan Asian, Thai and vegetarian options.\nThe first location opened in September 2008 and due to its quick success a second location opened a year later.\nThe atmosphere is fun and friendly for everyone no matter the occasion or time of day', '137820556427043_112540062108625_5900164_n.jpg', '0', '0', 'https://www.facebook.com/pages/MR-ROBOTO-TOKYO-GRILL/112471242115507', '', '', '0.00', '6', '1', '2003-09-13 03:52:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:21', null, null, null, '137820556427043_112540062108625_5900164_n.jpg', 'image/jpeg', '15228', '2014-01-24 10:31:21');
INSERT INTO `restaurants` VALUES ('25', 'Mr Roboto Tokyo Grill', 'Roboto Tokyo Grill is a fast casual restaurant chain located in Tallahassee, Florida. We serve Japanese hibachi and also offer a variety of pan Asian, Thai and vegetarian options.\nThe first location opened in September 2008 and due to its quick success a second location opened a year later.\nThe atmosphere is fun and friendly for everyone no matter the occasion or time of day', '137820562227043_112540062108625_5900164_n.jpg', '0', '0', 'https://www.facebook.com/pages/MR-ROBOTO-TOKYO-GRILL/112471242115507', '', '', '0.00', '6', '1', '2003-09-13 03:53:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:22', null, null, null, '137820562227043_112540062108625_5900164_n.jpg', 'image/jpeg', '15228', '2014-01-24 10:31:22');
INSERT INTO `restaurants` VALUES ('26', 'The Red Elephant Pizza and Grill', 'Our dream was to create a place that offered great food, but even more importantly, a place where people could recharge and reconnect. A let-your- hair-down, laugh out loud, get-together-with-friends-and-family kinda place. Welcome to Red Elephant.\nNow you can get our delicious pizzas right at your doorstep!', '1378206569167674_488753976874_7817027_n.jpg', '0', '0', 'https://www.facebook.com/RedElephantPizza?ref=ts', 'https://twitter.com/TheRedElephant/status/2210436746', '', '0.00', '6', '1', '2003-09-13 04:09:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:22', null, null, null, '1378206569167674_488753976874_7817027_n.jpg', 'image/jpeg', '13242', '2014-01-24 10:31:22');
INSERT INTO `restaurants` VALUES ('27', 'Mellow Mushroom', 'Originators of the classic Southern pizza! We have a unique flavorful crust that is sure to leave your tastebuds wanting more!', '1379849975996522_10151430249731184_2143830436_n.jpg', '0', '0', 'https://www.facebook.com/mellowmushroomHQ', 'https://twitter.com/MellowMushroom', 'https://plus.google.com/+mellowmushroom', '0.00', '6', '1', '2003-09-13 04:16:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:23', null, null, '1', '1379849975996522_10151430249731184_2143830436_n.jpg', 'image/jpeg', '20083', '2014-01-24 10:31:22');
