INSERT INTO `restaurants` VALUES ('29', 'Broadway\'s Hot Grill', 'Broadway’s Hot Grill is one of the newest restaurants in town, owned and operated by Gihan and Halim Hanna. Following their passion for the food industry, they opened their first restaurant nine years ago in Tallahassee, FL, sharing quality Gyros, Philadelphia cheese steak, and hamburgers, among many other varieties of food, with a cutting edge. \n\nSucceeding with their first restaurant, Mr. and Mrs. Hanna decided to go independent and opened Broadway’s Hot Grill with currently two locations for Broadway’s Hot Grill located at the Tallahassee Mall in the food court, 2415 N. Monroe Street and on 435 W. Tennessee St. next to Popeye’s. At Broadway’s Hot Grill everything is made fresh! You will find a variety of foods – from American to Greek- backed by more than 10 years of experience. At Broadway’s Hot Grill you can enjoy your favorite Philly cheese steak, Gyros, Angus beef Hamburgers, Fried Chicken, Wings and much more. If you don’t like having to wait on the North Florida Fair to enjoy your Funnel Cake, once a year, you can stop by Broadway’s Hot Grill and be sure to find different flavors year round. \n\nBroadway’s Hot Grill is opened early mornings, for your convenience, to enjoy the most important meal of the day. Find a variety of breakfast items from ham, eggs, grits, waffles, pancakes, and much more. If you are a seafood lover they also have Butterfly shrimp and Catfish, Freshly cut Gyro meat, homemade rice and your choice of a side. ', '1378207774581735_158518697635917_1475880145_n.jpg', '2', '0', 'https://www.facebook.com/pages/Broadways-Hot-Grill/158518367635950?ref=stream', '', '', '0.00', '6', '1', '2003-09-13 04:29:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:23', null, null, null, '1378207774581735_158518697635917_1475880145_n.jpg', 'image/jpeg', '6934', '2014-01-24 10:31:23');
INSERT INTO `restaurants` VALUES ('30', 'Masa', 'Located in Tallahassee\'s trendy Midtown area, this Asian-inspired seafood and sushi restaurant is the creation of one of Tallahassee\'s most experienced restaurateurs, Lucy Ho.\nWith a flair for decor and an eye for delicious cuisine, Masa creates a space for diners to enjoy unique flavors that are both familiar and distinguished. Masa\'s Asian-fusion menu offers a creative blend of Eastern and Western cuisines with something for everyone to enjoy.', '1378208272Masa.jpg', '2', '0', 'https://www.facebook.com/pages/Masa-Tallahassee-Asian-Fusion-Cuisine-Sushi-Bar/171743442915777', '', 'https://plus.google.com/107697155196520021410/about', '0.00', '6', '1', '2003-09-13 04:37:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:23', null, null, null, '1378208272Masa.jpg', 'image/jpeg', '9618', '2014-01-24 10:31:23');
INSERT INTO `restaurants` VALUES ('31', 'Bella Bella Italian Restaurant', 'Locally owned and operated for 10 years, bella bella is known for its homemade fresh Italian cuisine. Come join us for lunch or dinner in our cozy dining room or for a glass of wine or a beer. Be sure to check out our new extensive craft beer menu in the \"Midtown Vino Room.\"', '1378208726380951_331115500232409_1048512700_n.jpg', '2', '0', 'https://www.facebook.com/BellaBellaTallahassee', 'https://twitter.com/BellaBellaFL', 'https://plus.google.com/113602864505365318447/about', '0.00', '6', '1', '2003-09-13 04:45:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:24', null, null, null, '1378208726380951_331115500232409_1048512700_n.jpg', 'image/jpeg', '15100', '2014-01-24 10:31:23');
INSERT INTO `restaurants` VALUES ('32', 'Wells Brothers Bar and Grill', 'Wells Brothers has received “Best Burger” honors in the FSView and Florida Flambeau Best of Tallahassee Awards for three years running. If you haven’t checked out our food for yourself, come on in and see what you’ve been missing.\nWells Brothers offers casual and affordable food for just about every taste. Burgers are a house favorite, and the buzz is that building your own is fun. Rumor also has it that the wings are out of this world.\nHerbivores won’t go hungry either. We have vegetarian option. You could have dessert for supper, too. There’s definitely no meat in the chocolate shake.\nWells Brothers is open for lunch, dinner, and drinks seven days a week. Come on in and have a seat.', '1378209271media0.gif', '2', '0', '', '', 'https://plus.google.com/102415803968002032627/about', '0.00', '6', '1', '2003-09-13 04:54:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:24', null, null, null, '1378209271media0.gif', 'image/gif', '14994', '2014-01-24 10:31:24');
INSERT INTO `restaurants` VALUES ('33', 'Burrito Boarder', 'Burrito Boarder leaps into the dynamic fast casual Fresh Mexican food arena with a whole new theme based upon the popular “boarding” culture. The restaurant is designed to be an interactive experience where great comfort food can be enjoyed in an atmosphere that is stimulating, friendly, and familiar to the ever-growing family of extreme board sports enthusiasts.\n', '1378209715200272_10150119288050349_2829399_n.jpg', '0', '0', 'https://www.facebook.com/pages/Burrito-Boarder/189178030348', 'https://twitter.com/BurritoBoarder', 'https://plus.google.com/117179551447331290026/about', '0.00', '6', '1', '2003-09-13 04:57:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:24', null, null, null, '1378209715200272_10150119288050349_2829399_n.jpg', 'image/jpeg', '17377', '2014-01-24 10:31:24');
INSERT INTO `restaurants` VALUES ('34', 'Tee-Jay Thai Sushi ', 'Escape to a Relaxing Asian Atmosphere! ', 'logodefault.jpg', '0', '0', '', '', '', '10.00', '6%', '1', '2018-09-13 08:41:00', '', '98', '2014-01-04 18:05:54', '2014-01-24 10:31:25', null, null, null, 'logodefault.jpg', 'image/jpeg', '2808', '2014-01-24 10:31:24');
INSERT INTO `restaurants` VALUES ('35', 'Gordos Cuban Restaurant', 'Gordos brings the flavor and flair of Cuban food to Tallahassee. The extensive menu has traditional fare such as croquetas, yuca, empanadas, maduros, and Cuban sandwiches, as well as delicious burgers, salads, and sandwiches that have a Cuban twist. The casual atmosphere provides a welcoming dining experience for groups of all ages. Gordos\' happy hour and beer specials are sure to please, as Gordos knows that there\'s nothing better than washing down a hot pressed Cuban sandwich and a basket of seasoned Gordos fries with your favorite ice cold brew, especially after a hard day\'s work.', '13797648421005124_10151642683912528_548254060_n.jpg', '2', '0', 'https://www.facebook.com/gordoscubanfood/info', '', '', '0.00', '6', '1', '2021-09-13 05:00:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:25', null, null, null, '13797648421005124_10151642683912528_548254060_n.jpg', 'image/jpeg', '18976', '2014-01-24 10:31:25');
INSERT INTO `restaurants` VALUES ('36', 'California Chicken Grill', 'Our food is always cooked to order, fresh. Everything is grilled or baked. We don’t even own a fryer. All of our side dishes and sauces are made from scratch in the store every day and we only use the freshest market produce.\n\nWe have something for everyone. From the ultra-health conscious, to the every day fast food addict, we have something that will satisfy your taste buds. We provide an alternative to a greasy pizza or yet another night at some burger joint. It’s like a home cooked meal without any cooking.', '1379765693logo.jpg', '2', '0', 'https://www.facebook.com/CaliforniaChickenGrill', 'https://twitter.com/cachickengrill', '', '0.00', '6', '1', '2021-09-13 05:14:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:25', null, null, null, '1379765693logo.jpg', 'image/jpeg', '23544', '2014-01-24 10:31:25');
INSERT INTO `restaurants` VALUES ('37', 'Harry\'s Seafood Bar and Grille', 'We’ve taken the best of Cajun, Creole and Southern flavors infused with a current day twist to create some of our most popular dishes like Shrimp and Scallop Orleans, Grilled Chicken Baton Rouge, Crab Crusted Blackened Red Fish, Bourbon Street Salmon and French Quarter Beef Tenderloin to name a few.\nWith a great selection of Seafood, Chicken, Beef, Pork along with Burgers, Po ‘Boys, Salads and much more, Harry’s menu is sure to have something for everyone.', '1379766155971729_573288592709600_1312674190_n.jpg', '0', '0', 'https://www.facebook.com/harrys.tallahassee', 'http://www.twitter.com/hookedonharrys', 'http://www.twitter.com/hookedonharrys', '0.00', '6', '1', '2021-09-13 05:22:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:26', null, null, null, '1379766155971729_573288592709600_1312674190_n.jpg', 'image/jpeg', '17096', '2014-01-24 10:31:26');
INSERT INTO `restaurants` VALUES ('38', 'Little Athens Gyro', 'The best Greek food around! Gyros, salads, and more!', '137976672514234_218912241613_1092017_n.jpg', '2', '0', 'https://www.facebook.com/pages/Little-Athens-Gryo/217344491613?ref=ts', 'https://twitter.com/Little_Athens', 'https://plus.google.com/110362962135447103298/about', '0.00', '6', '1', '2021-09-13 05:32:00', 'contact@gyromenu.com', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:26', null, null, null, '137976672514234_218912241613_1092017_n.jpg', 'image/jpeg', '18011', '2014-01-24 10:31:26');
INSERT INTO `restaurants` VALUES ('39', 'Prime Time Lounge & Restaurant ', 'At Prime Time we are revolutionizing the sports bar and introducing the sports lounge experience. We are committed to providing excellent customer service and quality and exotic menu choices without exceeding the standard sports bar prices. Relax and indulge at Prime Time. ', '1379767297524663_272730486196203_230999488_n.jpg', '1', '0', 'https://www.facebook.com/PrimeTimeTallahassee', 'https://twitter.com/PrimeTimeTally', '', '0.00', '6', '1', '2021-09-13 05:41:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:26', null, null, null, '1379767297524663_272730486196203_230999488_n.jpg', 'image/jpeg', '30051', '2014-01-24 10:31:26');
INSERT INTO `restaurants` VALUES ('40', 'Chubby\'s Chicken Fingers & More', 'Welcome to Chubby\'s Chicken Fingers. We take pride in serving great chicken fingers and much more. Our wings come naked or breaded, with sauces including buffalo, honey bbq, garlic parmesan, and more. We also have great buffalo wraps and chicken wraps, plus chicken and rice dishes in original, deluxe, cuban, and mexican.\n', '1379767721180212_149006258489296_5755051_n.jpg', '2', '0', 'https://www.facebook.com/ChubbysChickenFingers', 'https://twitter.com/ChubbyBox', 'https://plus.google.com/117152666014493559695/about', '0.00', '6', '1', '2021-09-13 05:48:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:27', null, null, null, '1379767721180212_149006258489296_5755051_n.jpg', 'image/jpeg', '16305', '2014-01-24 10:31:27');
INSERT INTO `restaurants` VALUES ('41', 'Brooklyn Pizza', 'Brooklyn Pizza has pretty much the best pizza in Tallahassee, maybe the country! Stop in to check out our AWESOME lunch specials, plus all our other great menu options like salads, soups, subs, and more!\n\nWe Deliver!', '1379768090580039_433163860069398_573925744_n.jpg', '0', '0', 'https://www.facebook.com/egsbrooklynpizza', '', '', '0.00', '6', '1', '2021-09-13 05:54:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:27', null, null, null, '1379768090580039_433163860069398_573925744_n.jpg', 'image/jpeg', '13843', '2014-01-24 10:31:27');
INSERT INTO `restaurants` VALUES ('42', 'Bandidos Burritos', 'Today people are rediscovering authentic mexican cuisine and the Bandidos Burrito Company has kept it\'s promise to bring the best possible mexican cuisine to you, the customer, at a fair price.\n\nWe at Bandidos Burrito Company are dedicated to serving you genuine wholesome burritos made with all fresh ingredients. And we don\'t say WE ROLL FATTIES for nothing. Our burritos are as large as they are delicious. But our menu doesn\'t stop there. We guarantee all of our menu items are made with the finest ingredients. The quality, purity and goodness in our products are proven in their taste.', '1379768480interfaces_off_3x4.jpg', '2', '0', '', '', '', '0.00', '6', '1', '2021-09-13 06:01:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:28', null, null, null, '1379768480interfaces_off_3x4.jpg', 'image/jpeg', '17330', '2014-01-24 10:31:27');
INSERT INTO `restaurants` VALUES ('43', 'Lucy & Leo\'s Cupcakery ', 'Two girls walked into an exquisite (and very tiny) cupcake shop while vacationing in London, England, and that is how Lucy & Leo’s Cupcakery came to life. They had a “lightbulb” moment, looked at each other and decided they had to open their own cupcakery in Tallahassee. The country was in a recession and they thought people needed a sweet, inexpensive treat to celebrate themselves.\n\nJean Bates hailed from slinging drinks and food in many Tallahassee restaurants through college as well as managing the Fresh Market. In 2008, Jean graduated with her MBA from Florida State University and entered the not so abundant job market at that time.\n\nPaula Lucas worked in retail all throughout college and was a retail General Manager “lifer;” although she had tied on an apron quite a few times in life alongside her Grandma and Dad, who were both great bakers.\n\nCollectively, they had the MBA brains, the biz owner savvy and some amazing recipes for sweet confections up their sleeves.', '13797690841289_10151593290013172_1694566775_n.jpg', '2', '0', 'https://www.facebook.com/pages/Lucy-Leos-Cupcakery/76315503171', 'https://twitter.com/LucyLeo', '', '0.00', '6', '1', '2021-09-13 06:11:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:28', null, null, null, '13797690841289_10151593290013172_1694566775_n.jpg', 'image/jpeg', '36340', '2014-01-24 10:31:28');
INSERT INTO `restaurants` VALUES ('44', 'The Crepe Vine', 'began in the summer of 2004, when I had the idea of opening a crepe restaurant in Tallahassee. I had just returned from six weeks in the Greek islands where I had tasted my first crepe. I was excited about introducing this fabulous Mediterranean food to my friends at Florida State University. Lots of people talk about opening their own restaurant, but after tasting those crepes in Greece I started to think about this idea seriously. So I began planning, experimenting and initiated the process of tossing ideas for crepe recipes around with my fraternity brothers.\n\nThe first step in my plan finally came to fruition in March, 2005. The recipes I’d been tinkering with on a cast iron griddle in a small fraternity kitchen were finally complete! A fraternity house meal plan followed, and I smiled as my hungry fraternity brothers waited in line for dinner outside the “crepe room.” The crepes were truly something new to my friends and one of my favorite comments was “now I’ve tasted heaven in a crepe”.\n\nAfter this initial, quiet success, I chose a location for the restaurant. My friends pitched in as we began the renovations. We painted, swept, nailed, and did whatever else was needed to make this dream of mine come true. Before I knew it, everyone was enjoying crepes on The Crepevine’s opening day: June 9, 2006, the very same day as the first World Cup game! ', '1379770270227880_531314386886172_1284372388_n.jpg', '2', '0', 'https://www.facebook.com/CrepevineTallahassee', 'https://twitter.com/TheCrepevine', '', '0.00', '6', '1', '2021-09-13 06:31:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:28', null, null, null, '1379770270227880_531314386886172_1284372388_n.jpg', 'image/jpeg', '35364', '2014-01-24 10:31:28');
INSERT INTO `restaurants` VALUES ('45', 'Po\' Boys Creole Cafe', 'Po’ Boys Creole Café is a New Orleans-themed restaurant chain based in Florida that serves traditional Creole and Cajun fare, including gumbo, jambalaya, crawfish, red beans and rice, specialty Louisiana beers and their namesake, po’ boy sandwiches. Po’ Boys Creole Cafe offers a full-service Sunday brunch and hosts annual Mardi Gras bashes, Crawfish festivals and Fat Tuesday celebrations. The atmosphere of Po’ Boys Creole Cafe is distinctly New Orleans with photographs of Big Easy landmarks and Mardi Gras memorabilia. In 1992, Po’ Boys Creole Café founders opened the first location in Tallahassee, Florida with $17,000. Today Tallahassee has three Po’ Boys Creole Café locations serving Killearn, Downtown and Pensacola Street.', '1379850710images.jpeg', '2', '0', 'https://www.facebook.com/pages/Po-Boys-Creole-Cafe/16807562566', '', '', '0.00', '6', '1', '2022-09-13 04:51:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:29', null, null, null, '1379850710images.jpeg', 'image/jpeg', '15481', '2014-01-24 10:31:28');
INSERT INTO `restaurants` VALUES ('46', 'Sweet Rack Rib Shack', 'Located on the edge of the FSU campus, Sweet Rack Rib Shack is an Authentic Southern Style BBQ Joint. We offer award winning Barbecue smoked over local cherry wood, hand patted burgers, & classic southern sides made fresh daily and can offer something for everyone.', '1379851185225085_334973546595338_1239683677_n.jpg', '2', '0', 'https://www.facebook.com/pages/Sweet-Rack-Rib-Shack/297643763661650', 'https://twitter.com/SweetRackRibSha', 'https://plus.google.com/112691003169594945126/posts', '0.00', '6', '1', '2022-09-13 04:59:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:29', null, null, null, '1379851185225085_334973546595338_1239683677_n.jpg', 'image/jpeg', '27181', '2014-01-24 10:31:29');
INSERT INTO `restaurants` VALUES ('47', 'Paisley Cafe', 'The Paisley Concept is all about fewer ingredients and the highest quality ingredients available. We are embracing the rule of seven ingredients or less! No high fructose corn syrup, real butter and, of course, olive oil! It’s amazing once you are used to seven ingredients or less, it’s hard to compare another style of cooking, especially at home. We want to inspire our friends and family with our concepts from our kitchen to yours.', '1379851618560930_369588766439890_1274163022_n.jpg', '2', '0', 'https://www.facebook.com/PaisleyCafe', 'https://twitter.com/PaisleyCafe/statuses/320313038886551554', 'https://plus.google.com/109253914028811732843/about', '0.00', '6', '1', '2022-09-13 05:06:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:29', null, null, null, '1379851618560930_369588766439890_1274163022_n.jpg', 'image/jpeg', '15695', '2014-01-24 10:31:29');
