INSERT INTO `restaurants` VALUES ('50', 'Jasmine Garden', 'Indulge in the most delicious Chinese food in the Lauderdale by the Sea area! Seafood, Fried Rice, and more!', '1380888350l.jpg', '0', '0', 'https://www.facebook.com/pages/Jasmine-Garden/116663361691838', '', 'https://plus.google.com/101408732775829380322/about?gl=nl&hl=en', '0.00', '6', '1', '2004-10-13 05:05:00', '', '1013', '2014-01-04 18:05:54', '2014-01-24 10:31:30', null, null, '1', '1380888350l.jpg', 'image/jpeg', '35025', '2014-01-24 10:31:30');
INSERT INTO `restaurants` VALUES ('51', 'Snapper\'s Waterfront Restaurant', '\nWaterfront Dining at Snappers Key Largo Restaurant & Tiki Bar\n\nFrom the Freshest local Seafood to prime cuts of beef as well as homemade soups and chowders Snapper\'s Waterfront Restaurant has something for everyone. Snapper\'s offers an eclectic menu of the freshest seafood prepared with Caribbean, Mexican, and Asian flavors. Snapper\'s offers twice daily specials based on fresh locally caught fish from the beautiful Florida Keys waters.', '1380916071Screen shot 2013-10-04 at 3.41.15 PM.png', '2', '0', '', '', '', '10.00', '7.5%', '1', '2004-10-13 12:47:00', '', '98', '2014-01-04 18:05:54', '2014-01-24 10:31:31', null, null, null, '1380916071Screen_shot_2013-10-04_at_3.41.15_PM.png', 'image/png', '36358', '2014-01-24 10:31:31');
INSERT INTO `restaurants` VALUES ('52', 'Mrs. Mac\'s Kitchen ', 'Key Largo, relish local dishes, like Key Lime Pie,. at a local favorite, Mrs. Mac\'s Kitchen. Consistently rated in the top 3 out of 47 restaurants in Key Largo on.', '1380917825Screen shot 2013-10-04 at 4.10.39 PM.png', '2', '0', '', '', '', '10.00', '7.5%', '1', '2004-10-13 13:17:00', '', '98', '2014-01-04 18:05:54', '2014-01-24 10:31:31', null, null, null, '1380917825Screen_shot_2013-10-04_at_4.10.39_PM.png', 'image/png', '37080', '2014-01-24 10:31:31');
INSERT INTO `restaurants` VALUES ('53', 'Mango\'s Tropical Cafe', 'Come enjoy the party at Mango\'s Tropical Cafe!\nEnjoy your evening of great entertainment and fabulous food prepared by our talented chefs. Our menu offers a wide selection of delicious items to choose from. Let us make your dining experience a memorable one! ', '1380991955Screen Shot 2013-10-05 at 12.48.20 PM.png', '2', '0', '', '', '', '$10', '6%', '1', '2005-10-13 09:52:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:32', null, null, null, '1380991955Screen_Shot_2013-10-05_at_12.48.20_PM.png', 'image/png', '34900', '2014-01-24 10:31:31');
INSERT INTO `restaurants` VALUES ('54', 'Two Georges Waterfront Restaurant, Lounge and Sports Bar', 'Located on the Intracoastal waterway, Two Georges has been a fixture in Boynton Beach for over 50 years. We are well known for serving the freshest seafood in town. Maryland crab cakes and fresh local fish are the house specialty. Our thatch roof and island decor will make you feel like your eating in the Keys. Whether you arrive by boat or car you will enjoy quality food in a relaxed atmosphere. If not ready for a full meal, feel free to head over to our patio bar and enjoy a frozen cocktail or cold beer while watching your favorite sporting event on our 20 flat screen TVs. Our local live bands on the weekends is always a crowd favorite.', '1381249208two georges.png', '2', '0', '', '', '', '10', '6.00%', '1', '2008-10-13 09:20:00', '', '1057', '2014-01-04 18:05:54', '2014-01-24 10:31:32', null, null, null, '1381249208two_georges.png', 'image/png', '12750', '2014-01-24 10:31:32');
