INSERT INTO `restaurants` VALUES ('57', 'New\'s Cafe', 'News Cafe is a quaint sidewalk cafe, restaurant, bar, newsstand and bookstore located at the corner of 8th Street and Ocean Drive in the Art Deco District of Miami Beach.', '1381253291news-cafe-logo.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 10:28:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:33', null, null, null, '1381253291news-cafe-logo.png', 'image/png', '31575', '2014-01-24 10:31:33');
INSERT INTO `restaurants` VALUES ('58', 'Cafe Prima Pasta', 'Zagat rated Italian restaurant with family flavor. ', '1381253519shapeimage_2.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 10:31:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:33', null, null, null, '1381253519shapeimage_2.png', 'image/png', '19174', '2014-01-24 10:31:33');
INSERT INTO `restaurants` VALUES ('59', 'Joe\'s Stone Crab', 'For 101 years, no visit to Miami has been complete without stopping in at Joe\'s Stone Crab. From the beginning, it has always been the love of food, family, and friends that has brought in customers and kept them coming.', '1381253641header_r1_c01_f2.gif', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 10:34:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:34', null, null, null, '1381253641header_r1_c01_f2.gif', 'image/gif', '10530', '2014-01-24 10:31:33');
INSERT INTO `restaurants` VALUES ('60', 'OLA Miami', 'Nationally acclaimed Latin Chef, Horacio Rivadero, has brought the essential flavors of Latin America to OLA Restaurant in Miami Beach.Begin your gastronomic adventure with a specialty mojito then be prepare to be blown away by Chef Rivadero\'s\' world renown ceviches. Entrees are prepared with a creative combination of Pan Latin, Spanish and Caribbean flavors. Indulge in Crispy Pork with mustard Mojo, Beef Tenderloin Churrasco or Florida Sweet Corn Empanada. A culinary journey unlike anything you have ever experienced.', '1381253844Screen Shot 2013-10-08 at 1.35.29 PM.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 10:37:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:34', null, null, null, '1381253844Screen_Shot_2013-10-08_at_1.35.29_PM.png', 'image/png', '20906', '2014-01-24 10:31:34');
INSERT INTO `restaurants` VALUES ('61', 'Le Bouchon Du Grove', 'A Bouchon is a friendly little restaurant offering a French Menu and using only the best local products. In the middle of Coconut Grove, as Christian and Jeanne welcome you everyday to a warm and relaxed atmosphere, come and taste our unique cuisine which is a blend of Lyon with a splash of South Florida.', '1381254072logo.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 10:41:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:34', null, null, null, '1381254072logo.png', 'image/png', '42217', '2014-01-24 10:31:34');
INSERT INTO `restaurants` VALUES ('62', 'The Capital Grille', 'It is our sole desire that everything, and we mean everything, that arrives at your table at The Capital Grille delights you. To ensure that experience, we use only the finest, freshest ingredients, artfully prepared in recipes designed to engage all of your senses. Let Executive Chef Jim Nuetzi tell you more in the video above.', '1381254939the-capital-grille.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 10:55:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:35', null, null, null, '1381254939the-capital-grille.png', 'image/png', '8221', '2014-01-24 10:31:35');
INSERT INTO `restaurants` VALUES ('63', 'Green Street Cafe', 'GreenStreet Cafe Lounge and Restaurant, Coconut Grove\'s premier \"seen and be seen\" restaurant was founded 24 years ago, by husband and wife team, Sylvano and Maida Bignon. Throughout the years, their European background has influenced them to make their place evolve into a \"Lifestyle\" , a friendly atmosphere, a meeting place at any time of day or night, illustrated by a large sign on a mirror saying \" Where There is Love, there is Life\"! It is rare not to encounter athletes, local politicians, artists or simply thousands of locals enjoying just that, life at GreenStreet. Breakfast is a must, but so is lunch, dinner and late night as it is GreenStreet\'s philosophy to always serve good food. The laughter is easy, the place feels good, this is a great scene. And at the end of the day, Sylvano and Maida are happy, because today, for one more day and thanks to all of you, there was Life and Love at GreenStreet in Coconut Grove.', '1381256751Screen Shot 2013-10-08 at 2.22.26 PM.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 11:25:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:35', null, null, null, '1381256751Screen_Shot_2013-10-08_at_2.22.26_PM.png', 'image/png', '27589', '2014-01-24 10:31:35');
INSERT INTO `restaurants` VALUES ('64', 'Atchana\'s East West Kitchen', 'When we say our Thai food is fresh, we mean FRESH! In fact, we go straight to the farm when it comes to much of our produce and spices. See the woman in the field with the lemongrass, galanga and papaya? Looks like she’s in Thailand, right? Nope. That would be homestead, and that’s where we get those spicy hot peppers and other the taste-infused natural ingredients you’ll find in our dishes.', '1381256970Screen Shot 2013-10-08 at 2.27.31 PM.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 11:29:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:35', null, null, null, '1381256970Screen_Shot_2013-10-08_at_2.27.31_PM.png', 'image/png', '7718', '2014-01-24 10:31:35');
INSERT INTO `restaurants` VALUES ('65', 'Town Kitchen & Bar', 'Our kitchen philosophy is centered on creative use of traditional foods, focusing on freshness, attention to detail, use of quality ingredients and uniqueness in our recipes. Our willingness to try new and unique ideas, never lacking enthusiasm with our foods and our interest in entertaining our guests sets us apart.', '1381259454logo.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 12:10:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:36', null, null, null, '1381259454logo.png', 'image/png', '14953', '2014-01-24 10:31:36');
INSERT INTO `restaurants` VALUES ('66', 'Area 31', 'Habitually innovative, often breathtaking and always welcoming, Area 31 is here to make sure you\'re never more than an elevator ride from a singular Miami experience.', '1381259737area31_logo.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 12:15:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:36', null, null, null, '1381259737area31_logo.png', 'image/png', '9090', '2014-01-24 10:31:36');
INSERT INTO `restaurants` VALUES ('67', 'Perricone\'s Marketplace & Cafe', 'For over a decade, Perricone\'s has built a stellar reputation as South Florida\'s best Italian restaurant. Heralded by Zagat, Forbes Magazine and thousands of satisfied customers alike, this quaint Italian restaurant and gourmet market nestled in the heart of downtown Miami has given patrons a unique dining and shopping experience for over a decade. Have you experienced Perricone\'s yet?\n\nThe restaurant\'s Italian cuisine is legendary. Fodor\'s raved, \"Recipes have been handed down from generation to generation and the food is simple, clean and precious.\" A review by Frommer\'s on the New York Times web site called Perricone\'s \"One of the most welcoming spots downtown with delectable sandwiches, quick and delicious pastas, and hearty salads.\"', '1381260436Screen Shot 2013-10-08 at 3.27.06 PM.png', '0', '0', '', '', '', '$10', '6%', '1', '2008-10-13 12:21:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:37', null, null, null, '1381260436Screen_Shot_2013-10-08_at_3.27.06_PM.png', 'image/png', '10858', '2014-01-24 10:31:36');
INSERT INTO `restaurants` VALUES ('68', 'Casa Juancho Restaurant', 'Casa Juancho has been bestowed numerous awards and proclaimed by various national magazines as a \"must\" when dining out in South Florida. Our award winning cuisine is prepared with the freshest seafood of Spain and South Florida. We also offer fowl, poultry and USDA Prime Beef. Our extensive wine cellars offer over 450 aged and vintage wines and has the rarest collections of Spanish wines in the United States.\n\nFrom the moment you enter Casa Juancho, you feel as though you are in Spain. The authentic brick, red tiles, fabrics and pottery from Spain create a warm hospitable atmosphere to enjoy some of Spain\'s finest cuisine.', '1381260965Screen Shot 2013-10-08 at 3.28.47 PM.png', '0', '0', '', '', '', '$10', '6%', '1', '2008-10-13 12:36:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:37', null, null, null, '1381260965Screen_Shot_2013-10-08_at_3.28.47_PM.png', 'image/png', '10629', '2014-01-24 10:31:37');
INSERT INTO `restaurants` VALUES ('69', 'Jaguar Restaurant', 'Jaguar Ceviche Spoon Bar and Latam Grill fuels Miami’s flourishing Latin food scene with fresh cuisine inspired by the flavors of Latin America. Enjoy classic dishes prepared by a well trained kitchen staff such as Chupe de Camaron or one of their own creations with a more contemporary approach, for example the ceviche spoon sampler.', '1381261857jaguar-logo.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 12:50:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:37', null, null, null, '1381261857jaguar-logo.png', 'image/png', '6507', '2014-01-24 10:31:37');
INSERT INTO `restaurants` VALUES ('70', 'Francesco', 'Francesco Chacarilla has been putting together fresh, modern, day and night, with bar and snacks. ', '1381262224Screen Shot 2013-10-08 at 3.54.51 PM.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 12:57:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:38', null, null, null, '1381262224Screen_Shot_2013-10-08_at_3.54.51_PM.png', 'image/png', '17780', '2014-01-24 10:31:37');
INSERT INTO `restaurants` VALUES ('71', 'Tropical Chinese Restaurant', 'Celebrating 26 years. Tropical Chinese Restaurant opened in November 1984, renowned by locals as well as world travelers.\n\nAt Tropical, we serve authentic Hong Kong style push cart Dim Sum hand crafted from our own kitchen. \n\nTropical Chinese Restaurant believes that variety is the keystone of a great meal. Our menu offers culinary creations of authentic Hong Kong style cooking using only the best and freshest ingredients, only non-processed foods. Amongst the dishes to tempt are “Emperor’s Prawns in Grand Marnier Sauce,” “Sizzling Black Pepper Scallops,” “Lobster Song in Iceberg Lettuce Cups” and the famous signature “Peking Duck” carved and wrapped table side.\n\nFully accommodating for public and private dining. Tropical Chinese is the ideal location for your next event from intimate one-on-one dinner to the most important meeting of the year, Tropical Chinese will spare no effort to make your visit an unforgettable experience. \n\nOur experienced staff provide the utmost professional service and care. There are three dining areas. The main dining room has an open glass kitchen seats up to 120 guests, the full service bar dining room seats up to 100 guests, and a VIP private/banquet room seats up to 40 guests.', '1381262441Screen Shot 2013-10-08 at 3.58.33 PM.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 13:00:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:38', null, null, null, '1381262441Screen_Shot_2013-10-08_at_3.58.33_PM.png', 'image/png', '4427', '2014-01-24 10:31:38');
INSERT INTO `restaurants` VALUES ('72', 'Ceviche 105', 'CVI.CHE 105 Invites you to enjoy the most exquisite traditional peruvian dishes in a modern presentation, in a chilled and pleasant environment where excellent food and great service are combined in order to make your lunch or dinner an enjoyable experience.', '1381262653logocvicheslogan.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 13:04:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:38', null, null, null, '1381262653logocvicheslogan.png', 'image/png', '5840', '2014-01-24 10:31:38');
INSERT INTO `restaurants` VALUES ('73', 'Monty\'s Sunset', 'Relax, it\'s Monty\'s. ', '1381262891logo-1.png', '1', '1', '', '', '', '', '', '1', '2008-10-13 13:08:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:39', null, null, null, '1381262891logo-1.png', 'image/png', '28319', '2014-01-24 10:31:38');
INSERT INTO `restaurants` VALUES ('74', 'Moon Thai', 'Moon Thai & Japanese was established on August 3rd, 2000, in Coral Gables, FL by lifetime chef and restaurant owner Jack Punma. Since then, the restaurant has expanded to include three additional locations: Kendall, Coral Springs, and Weston, FL. The menus at Moon Thai and Japanese are carefully prepared with only the highest quality ingredients. Customer service and satisfaction is our top priority so please visit any of our locations and enjoy the relaxing atmosphere. You may also use our easy to use online ordering system where you have access to our diverse menu from the comfort of your home. Please feel free to send us your comments or suggestions as our goal is to meet the needs of each and every one of our customers. Thank you for visiting our site.\n', '1381263231Screen Shot 2013-10-08 at 4.12.11 PM.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 13:13:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:39', null, null, null, '1381263231Screen_Shot_2013-10-08_at_4.12.11_PM.png', 'image/png', '7527', '2014-01-24 10:31:39');
INSERT INTO `restaurants` VALUES ('75', 'Versailles Restaurant', 'Versailles Restaurant, The World’s Most Famous Cuban Restaurant, has been serving tasty Cuban cuisine and culture to the South Florida community and tourists from around the world for four decades. Soon after it opened its doors in 1971, Versailles quickly became the gathering place and unofficial town square for Miami’s Cuban exiles. Today, it remains the unrelenting gauge of the community’s pulse. Not surprisingly, Versailles is typically the first place politicians visit locally to garner support from the Cuban exile community, and the restaurant is equally a favorite among the media for gathering commentary and footage of the community’s take on social and political issues. It is not uncommon to see local, national and international media set up camp in Versailles’ parking lot, where they’re sure to get a flood of local viewpoints.', '1381263420Screen Shot 2013-10-08 at 4.15.40 PM.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 13:17:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:39', null, null, null, '1381263420Screen_Shot_2013-10-08_at_4.15.40_PM.png', 'image/png', '14917', '2014-01-24 10:31:39');
INSERT INTO `restaurants` VALUES ('76', 'La Sandwicherie', 'Serving heavenly sandwiches in Sobe since 1988, La Sandwicherie captures the best of French savoir-faire in the simplest of settings to transport your taste buds to another world without costing you the earth. Daily fresh ingredients, crisp baguettes or croissants and the added magic of the infamous vinaigrette make for a true taste sensation. A must see in Miami Beach!', '1381263632Screen Shot 2013-10-08 at 4.17.42 PM.png', '0', '0', '', '', '', '$10', '6%', '1', '2008-10-13 13:20:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:40', null, null, null, '1381263632Screen_Shot_2013-10-08_at_4.17.42_PM.png', 'image/png', '12618', '2014-01-24 10:31:40');
INSERT INTO `restaurants` VALUES ('77', 'Barton G', 'By combining fine dining with fun dining, Barton G. The Restaurant makes each meal an experience, fulfilling the senses with enticing fragrances, extraordinary food and over-the-top presentations.\n\nNow celebrating 10 years of success on South Beach, the restaurant is the creation of events impresario Barton G. Weiss, whose innovative approach to entertaining has received worldwide acclaim.\n\nLocated on West Avenue, the restaurant features a lush tropical garden for al fresco dining that perfectly reflects the romantic mood of Miami, as well as a sleekly sophisticated interior done in cherry and zebra woods, with subtle shades of brown, bronze and copper. An onyx bar at the entrance is an elegant setting for cocktails and light fare.', '1381264638Screen Shot 2013-10-08 at 4.35.52 PM.png', '2', '0', '', '', '', '$10', '6%', '1', '2008-10-13 13:37:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:40', null, null, null, '1381264638Screen_Shot_2013-10-08_at_4.35.52_PM.png', 'image/png', '10808', '2014-01-24 10:31:40');
INSERT INTO `restaurants` VALUES ('78', 'Sazón Cuban Cuisine', 'Sazon Cuban Cuisine, a gem on the corner of Collins Ave. and 73rd street, creates the most delicious Cuban food in Miami Beach; consistently striking robust notes of authenticity with selections of inspired originality. Open 7 days a week, serving breakfast, lunch and dinner. Sazon provides a charming atmosphere in our warm and inviting dining room as well as in our outdoor covered patio, offering a full bar, boasting the best Mojito on Miami Beach as well as live entertainment on Friday and Saturday nights.\n\nThe menu is very creative with old standards offered the traditional way, as well as a variety of special dishes like the Sazon Pollo Enrollado and the Sazon Palomilla. New on the menu is our Filet Mignon and New York Strip Steaks. Seafood items include Grilled Fillet of Red Snapper, Mahi Mahi with Mango Sauce, Salmon with Grave Sauce, Several Shrimp dishes and delicious Paellas, an assortment of appetizers and homemade desserts.', '1381269062sazoncc-logo.png', '0', '0', '', '', '', '$10', '6%', '1', '2008-10-13 14:51:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:41', null, null, null, '1381269062sazoncc-logo.png', 'image/png', '24035', '2014-01-24 10:31:40');
INSERT INTO `restaurants` VALUES ('79', 'New Campo Argentino Steakhouse', 'Angus Certified Argentinean Steakhouse located on Miami Beach.', '13812692047c998a_0664f0b6cc697ffcafd3850c0949ddee.png_srz_347_87_75_22_0.50_1.20_0.png', '0', '0', '', '', '', '$10', '6%', '1', '2008-10-13 14:53:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:41', null, null, null, '13812692047c998a_0664f0b6cc697ffcafd3850c0949ddee.png_srz_347_87_75_22_0.50_1.20_0.png', 'image/png', '11694', '2014-01-24 10:31:41');
INSERT INTO `restaurants` VALUES ('80', 'Las Vegas Cuban Cuisine', 'Mariel Boat Lift 1980, 126 thousand Cuban\'s abandon the communist island in a massive exodus. The Vilariño family were among the fortunate to make it through the turbulent stretch and reach the land of the free. After years of hardship the family was determined to make the American dream come true.\n\nIn 1984 Antonio, his wife Nilda and five daughters bought their first restaurant, Las Vegas in Hollywood. While Antonio learned to cook, Nilda and the girls catered to loyal patrons providing personable service, which has proven to be a drawing factor in their enduring success. Shortly thereafter, Las Vegas became known as the Cuban hot spot in Hollywood, guaranteeing customers authentic Cuban dishes and the friendliest service in town. Today with many more restaurants, the family continues to offer the same quality service, food and atmosphere that attracted locals for the past twenty years.', '1381269332Screen Shot 2013-10-08 at 5.54.01 PM.png', '0', '0', '', '', '', '$10', '6%', '1', '2008-10-13 14:55:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:41', null, null, null, '1381269332Screen_Shot_2013-10-08_at_5.54.01_PM.png', 'image/png', '21346', '2014-01-24 10:31:41');
INSERT INTO `restaurants` VALUES ('81', 'Tamarind Thai Restaurant', 'We believe food is an integral part of culture. And we also believe that meal time is a time to relax and enjoy the company of one’s family and friends. It is our sincerest hope that by the time you leave our restaurant, you will consider us family as well.', '1381269471Tamarind_logo.png', '0', '0', '', '', '', '$10', '6%', '1', '2008-10-13 14:57:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:42', null, null, null, '1381269471Tamarind_logo.png', 'image/png', '11469', '2014-01-24 10:31:41');
INSERT INTO `restaurants` VALUES ('82', 'Indomania', 'Since the Indomania restaurant opened it\'s doors in February 2007 it has welcomed people from all over the world to an original taste and enjoyable way of dining. Based on the traditional Indonesian cuisine but seen through Dutch eyes, the Indomania restaurant invites you to try a great mix of flavors and ensures you an unforgettable experience. ', '1381326993mainlogo.gif', '2', '0', '', '', '', '$10', '6%', '1', '2009-10-13 06:56:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:42', null, null, null, '1381326993mainlogo.gif', 'image/gif', '3619', '2014-01-24 10:31:42');
INSERT INTO `restaurants` VALUES ('83', 'Sylvano Ristorante Italiano & Sports Bar', 'More than just a place to eat! Catch all the latest sports events on one of the many flat screen tv’s throughout the restaurant. From premier league to professional league, you can watch all of your favorite teams going head to head.', '1381327175Screen Shot 2013-10-09 at 9.57.47 AM.png', '2', '0', '', '', '', '$10', '6%', '1', '2009-10-13 06:59:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:42', null, null, null, '1381327175Screen_Shot_2013-10-09_at_9.57.47_AM.png', 'image/png', '6570', '2014-01-24 10:31:42');
INSERT INTO `restaurants` VALUES ('84', 'The Dutch', 'SO, WHAT’S GOOD HERE ANYWAY?\nWe cook things that make us happy, like a seasonal green market salad; a deluxe steak with a tower of shellfish; tasty sandwiches; flavorful curry or chili; homey roasted chicken and fresh pie or something altogether surprising and new. You should really check out the menus.', '1381327339Screen Shot 2013-10-09 at 10.00.30 AM.png', '2', '0', '', '', '', '$10', '6%', '1', '2009-10-13 07:02:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:43', null, null, null, '1381327339Screen_Shot_2013-10-09_at_10.00.30_AM.png', 'image/png', '12772', '2014-01-24 10:31:43');
INSERT INTO `restaurants` VALUES ('85', 'Cantina 27', 'Ristorante and Pizzeria Cantina 27 is a neighborhood gem famous for our authentic homemade pasta and bread.Our Brickstone oven is ideal for hand tossed crispy italian pizza, which is also available for carry-out. We have a wide and refined selection of Italian wines, most of them also available by the glass for people who like to indulge responsibly. Our family oriented staff, combined with a candle light atmosphere makes the place ideal for anything from the romantic dinner for two to big family gatherings in our 50 people private party room. Free parking after 6pm in the adjacent parking lot is a little extra perk in South beach.', '1381327452index~~element18.jpg', '2', '0', '', '', '', '$10', '6%', '1', '2009-10-13 07:04:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:43', null, null, null, '1381327452index__element18.jpg', 'image/jpeg', '7921', '2014-01-24 10:31:43');
INSERT INTO `restaurants` VALUES ('86', 'Carrabba\'s Italian Grill', 'We\'re not real chefs. We\'re real eaters.\n\nWe don\'t mean diners, gourmands or bon vivants. We\'re two Sicilian boys from Texas who love to cook and eat. We love the Sicilian food our parents and grandparents cooked. We love the Creole and Southern food our family members picked up passing through Louisiana and stepping off the boat right on the dock in Galveston. And we love the Western food that\'s just part of being in Texas.', '1381327577logo-carrabbas.png', '0', '0', '', '', '', '$10', '6%', '1', '2009-10-13 07:06:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:44', null, null, null, '1381327577logo-carrabbas.png', 'image/png', '9452', '2014-01-24 10:31:43');
INSERT INTO `restaurants` VALUES ('87', 'Lou\'s Beer Garden', 'We want to be able to provide a quality product that far exceeds what is regularly found in most bars and Wine boutiques.\n\nTo be able to make it affordable and exciting by keeping up with the seasons and giving the food a unique edge, without stepping over the Fine Dining line.\n\nThat’s the beauty of a Gastro Pub! ', '1381327752Screen Shot 2013-10-09 at 10.07.41 AM.png', '2', '0', '', '', '', '$10', '6%', '1', '2009-10-13 07:09:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:44', null, null, null, '1381327752Screen_Shot_2013-10-09_at_10.07.41_AM.png', 'image/png', '39828', '2014-01-24 10:31:44');
INSERT INTO `restaurants` VALUES ('88', 'George\'s Restaurant & Lounge', 'George’s is an Italian restaurant located in the heart of North Beach, FL. Owned and operated by George and Elizabeth Iglesias, a brother and sister combo that bring a whole new name to family operated businesses. They have been open for ten years, all of which have been at the same location. George’s main goal is to provide quality, good service and great food, which can only be why they are so immensely popular with the locals.', '1381328482Screen Shot 2013-10-09 at 10.19.47 AM.png', '0', '0', '', '', '', '$10', '6%', '1', '2009-10-13 07:21:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:44', null, null, null, '1381328482Screen_Shot_2013-10-09_at_10.19.47_AM.png', 'image/png', '15713', '2014-01-24 10:31:44');
INSERT INTO `restaurants` VALUES ('89', 'Norton\'s American Bar & Grill', 'American style bar grill and bar. ', '1381328783Screen Shot 2013-10-09 at 10.23.35 AM.png', '0', '0', '', '', '', '$10', '6%', '1', '2009-10-13 07:26:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:45', null, null, null, '1381328783Screen_Shot_2013-10-09_at_10.23.35_AM.png', 'image/png', '14290', '2014-01-24 10:31:44');
INSERT INTO `restaurants` VALUES ('90', 'FiFi\'s Seafood', 'Fifi\'s Place only uses locally caught and or sustainable fish. Long known by locals for its outstanding freshness, Fifi\'s Seafood has been discovered by visitors to our area as well. This has led to a recent expansion of the restaurant into the adjoining store front and has more than doubled the seating capacity. Famous for its seafood Paella and fresh Hog Snapper caught by local divers daily, we also offer the freshest stone crabs when in season and florida lobster.\n', '1381328964logo.png', '0', '0', '', '', '', '$10', '6%', '1', '2009-10-13 07:29:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:45', null, null, null, '1381328964logo.png', 'image/png', '8414', '2014-01-24 10:31:45');
INSERT INTO `restaurants` VALUES ('91', 'Mike\'s China Beach', 'Since started in 1995, we have been known for the best honey chicken, more fresh vegetables and impeccable house special garlic sauce. We cook with the same sauce for ourself .\n', '1381329093Screen Shot 2013-10-09 at 10.30.07 AM.png', '0', '0', '', '', '', '$10', '6%', '1', '2009-10-13 07:31:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:45', null, null, null, '1381329093Screen_Shot_2013-10-09_at_10.30.07_AM.png', 'image/png', '9519', '2014-01-24 10:31:45');
INSERT INTO `restaurants` VALUES ('92', 'Cafe Avanti Italian Restaurant', 'Luis Fuentes opened Café Avanti at 732 41st Street in Miami Beach in 1989. Twenty-one years later, he still owns and operates the Italian restaurant/bar at the same site, with the same chef (Constantino Cadavid) and many of the same waiters. Today, however, Fuentes has a new partner: his 27-year old daughter, Jessica Fuentes.\n\nThe Cuban-born Luis, 53, began his career making pizza while in junior and senior high school (he attended Miami High and then Miami-Dade College). He worked at a Coral Gables pizzeria prior to opening Café Avanti (the name means “forward” in Italian). Jessica grew up in Doral (FL) – and at Café Avanti. She studied Criminal Justice at Northeastern University in Boston and planned to become an attorney. During college, Jessica worked for Back Bay Restaurant Group. Upon graduating, she became manager of Back Bay’s renowned Boston steakhouse, Abe & Louie’s. “Hospitality is in my blood. There was no denying it,” declares Jessica. After gaining experience in the industry, Jessica decided it was time to “come home” She joined Café Avanti as General Manager on New Year’s Eve 2011 – and recently moved to Brickell Avenue.', '1381347179Screen Shot 2013-10-09 at 3.31.45 PM.png', '2', '0', '', '', '', '$10', '6%', '1', '2009-10-13 12:32:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:46', null, null, null, '1381347179Screen_Shot_2013-10-09_at_3.31.45_PM.png', 'image/png', '17616', '2014-01-24 10:31:45');
INSERT INTO `restaurants` VALUES ('93', 'Little Brazil', 'At Little Brazil Restaurant in Miami Beach, Florida, you can experience the true taste of Brazilizan dishes. All our food is prepared fresh and with the finest ingredients. We are open for lunch and dinner. Dine in our cozy dining area or have a wine or try the Brazilian beer and lunch or dinner in our bar area.', '1381347276top.gif', '2', '0', '', '', '', '$10', '6%', '1', '2009-10-13 12:34:00', '', '1058', '2014-01-04 18:05:54', '2014-01-24 10:31:46', null, null, null, '1381347276top.gif', 'image/gif', '16373', '2014-01-24 10:31:46');
